import "./SplashScreen.css";

const SplashScreen = () => {
  return (
    <div className="splash-screen">
      <div className="image-2-parent">
        <img className="image-2-icon" alt="" src="/image-2@2x.png" />
        <div className="ostrich-parent">
          <div className="ostrich">OSTRICH</div>
          <div className="your-requests-across">
            Your Requests Across Africa
          </div>
        </div>
      </div>
    </div>
  );
};

export default SplashScreen;
